Movie Info: Madras Cafe is a 2013 Indian political espionage thriller film directed by Shoojit Sircar and starring John Abraham, Nargis Fakhri and Rashi Khanna in lead roles. The film is set in the late 1980s and early '90s, during the time of Indian intervention in the Sri Lankan civil war and assassination of former Indian prime minister Rajiv Gandhi.

Madras Cafe was released on August 23, 2013. The film impressed most of the Indian critics but finished its theatrical run at the box office with average numbers.


